import "./App.css";

class SearchBar extends Component {
  render() {
    return (
      <div>
        <input type="text" className={this.props.className} />
        <button className="btn Button">
          <Icon className="Icon" />
        </button>
      </div>
    );
  }
}

export default SearchBar;
